import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import * as style from "./styles";

function SideMenu(props) {
  const navigator = useNavigate();
  return (
    <style.sideContainer>
      <style.sideBtn onClick={() => navigator("/profile")}>
        프로필
      </style.sideBtn>
      <style.sideBtn onClick={() => navigator("/interview")}>
        면접
      </style.sideBtn>
      <style.sideBtn onClick={() => navigator("/upload")}>업로드</style.sideBtn>
    </style.sideContainer>
  );
}

export default SideMenu;
